import "./App.css";
import ClassButton from "./components/ClassButton";
import FuncButton from "./components/FuncButton";
import HeadingText from "./components/HeadingText";

function App() {
  return (
    <div className="App">
      <HeadingText name="Daiva"></HeadingText>
      <HeadingText name="Learning React JS"></HeadingText>
      <FuncButton className="btn" title="Login"></FuncButton>
      <FuncButton className="btn" title="Signup"></FuncButton>
      <ClassButton name="Click me"></ClassButton>
    </div>
  );
}

export default App;
